import React from 'react';
import gallery from './images/gallery.png';
import './App.css';

import './SASS/main.scss';

function App() {
  return (
    <div className='homepage'>
      <div className='aboveFold'>
        <div className='aboveFold_photo'>
          <img className='aboveFold_photo-img' src={gallery} alt='logo' />
        </div>
        <div className='aboveFold_card'>
          <p className='aboveFold_card_content'>filler</p>
        </div>
      </div>
    </div>
  );
}

export default App;
